import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import PlayerList from "./Components/Player/PlayerList";

function RouterDef() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/home" element={<PlayerList />}>
            Home
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default RouterDef;
